import React from 'react';

function Home() {
  return (
    <div>
     <div className='Header-hero'>
        <div className='title_headerhero'>
           <p>Art Gallery, Where Creativity Blooms</p>
        </div>
        <div className='content_header-hero'>
           <p>Embark on a journey through the captivating world of
                  artistry.<br />
                  Explore stunning and innovative artworks from talented
                  artists. <br /><br />
                  Join us in making life more beautiful with art!</p>
        </div>
        <div className='img_header-hero'>
              <img className='img-home_hero' src='assets/images/home/Header-hero1.jpeg'></img>
        </div>
     </div>

    </div>
  );
}

export default Home;
